import React from 'react';
// import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

const Footer = () => {
  return (
    <Card className="text-center">
      <Card.Header>Contact Us</Card.Header>
      <Card.Body>
        <Card.Title>SAMPLE TEXT</Card.Title>
        <Card.Text>
          Lorem ipsum dolor sit amet, consectetur adipisicing elit. Minima illo consequuntur, veritatis maiores nesciunt asperiores necessitatibus vitae ipsam velit voluptas!
        </Card.Text>
      </Card.Body>
      <Card.Footer className="text-muted">Copyright &copy; Jed</Card.Footer>
    </Card>
  )
}

export default Footer
